import React from 'react';
import classes from './GridCategory.module.css';
import { Row, Col, Container } from 'react-bootstrap';

import W1 from '../../assets/images/W1.png';
import W2 from '../../assets/images/W2.png';
import W3 from '../../assets/images/W3.png';
import W4 from '../../assets/images/W4.png';
import W5 from '../../assets/images/W5.png';
import W6 from '../../assets/images/W6.png';
import W7 from '../../assets/images/W7.png';
import W8 from '../../assets/images/W8.png';

function GridCategory() {
    return (
        <Fragment>
        <Container className={classes.GridContainerStyle}>
            <Container >
                <Row >
                    <Col>
                        <Row><img  className={classes.GridCategoryStyle} src={W1}  /></Row>
                        <Row><img  className={classes.GridCategoryStyle} src={W2}  /></Row>
                    </Col>

                    <Col>
                        <Row>
                        <Col><img  className={classes.GridCategoryStyle} src={W3}  /> </Col>
                        <Col><img  className={classes.GridCategoryStyle} src={W4}  /> </Col>
                        </Row>
                    </Col>
                </Row>
            </Container>
            <Container >

                <Row>
                <Col>
                        <Row>
                        <Col><img  className={classes.GridCategoryStyle} src={W5}  /> </Col>
                        <Col><img  className={classes.GridCategoryStyle} src={W6}  /> </Col>
                        </Row>
                    </Col>

                    <Col>
                        <Row><img  className={classes.GridCategoryStyle} src={W7}  /></Row>
                        <Row><img  className={classes.GridCategoryStyle} src={W8}  /></Row>
                    </Col>


                </Row>
            </Container>
        </Container>
        </Fragment>
    )
}

export default GridCategory;
